static AccessToken createFromCache(Bundle bundle) {
  // Copy the list so we can guarantee immutable
  List<String> originalPermissions =
      bundle.getStringArrayList(TokenCachingStrategy.PERMISSIONS_KEY);
  List<String> permissions;
  if (originalPermissions == null) {
    permissions = Collections.emptyList();
  } else {
    permissions = Collections.unmodifiableList(new ArrayList<String>(originalPermissions));
  }

  return new AccessToken(
      bundle.getString(TokenCachingStrategy.TOKEN_KEY),
      TokenCachingStrategy.getDate(bundle, TokenCachingStrategy.EXPIRATION_DATE_KEY),
      permissions,
      TokenCachingStrategy.getSource(bundle),
      TokenCachingStrategy.getDate(bundle, TokenCachingStrategy.LAST_REFRESH_DATE_KEY));
}

/**
 * Returns provider setup information for a given email address
 *
 * <p>Vendor function: Select: FIND_PROVIDER Param: FIND_PROVIDER (String) Result:
 * FIND_PROVIDER_IN_URI FIND_PROVIDER_IN_USER FIND_PROVIDER_OUT_URI FIND_PROVIDER_OUT_USER
 * FIND_PROVIDER_NOTE (optional - null is OK)
 *
 * <p>Note, if we get this far, we expect "correct" results from the policy method. But throwing
 * checked exceptions requires a bunch of upstream changes, so we're going to catch them here and
 * add logging. Other exceptions may escape here (such as null pointers) to fail fast.
 *
 * @param domain The domain portion of the user's email address
 * @return suitable Provider definition, or null if no match found
 */
public Provider findProviderForDomain(String domain) {
  Bundle params = new Bundle();
  params.putString(FIND_PROVIDER, domain);
  Bundle out = getPolicy(FIND_PROVIDER, params);
  if (out != null && !out.isEmpty()) {
    Provider p = new Provider();
    p.id = null;
    p.label = null;
    p.domain = domain;
    p.incomingUriTemplate = out.getString(FIND_PROVIDER_IN_URI);
    p.incomingUsernameTemplate = out.getString(FIND_PROVIDER_IN_USER);
    p.outgoingUriTemplate = out.getString(FIND_PROVIDER_OUT_URI);
    p.outgoingUsernameTemplate = out.getString(FIND_PROVIDER_OUT_USER);
    p.note = out.getString(FIND_PROVIDER_NOTE);
    return p;
  }
  return null;
}

