int queryPurchases(Inventory inv, String itemType) throws JSONException, RemoteException {
  // Query purchases
  logDebug("Querying owned items, item type: " + itemType);
  logDebug("Package name: " + mContext.getPackageName());
  boolean verificationFailed = false;
  String continueToken = null;

  do {
    logDebug("Calling getPurchases with continuation token: " + continueToken);
    Bundle ownedItems =
        mService.getPurchases(3, mContext.getPackageName(), itemType, continueToken);

    int response = getResponseCodeFromBundle(ownedItems);
    logDebug("Owned items response: " + String.valueOf(response));
    if (response != BILLING_RESPONSE_RESULT_OK) {
      logDebug("getPurchases() failed: " + getResponseDesc(response));
      return response;
    }
    if (!ownedItems.containsKey(RESPONSE_INAPP_ITEM_LIST)
        || !ownedItems.containsKey(RESPONSE_INAPP_PURCHASE_DATA_LIST)
        || !ownedItems.containsKey(RESPONSE_INAPP_SIGNATURE_LIST)) {
      logError("Bundle returned from getPurchases() doesn't contain required fields.");
      return IABHELPER_BAD_RESPONSE;
    }

    ArrayList<String> ownedSkus = ownedItems.getStringArrayList(RESPONSE_INAPP_ITEM_LIST);
    ArrayList<String> purchaseDataList =
        ownedItems.getStringArrayList(RESPONSE_INAPP_PURCHASE_DATA_LIST);
    ArrayList<String> signatureList =
        ownedItems.getStringArrayList(RESPONSE_INAPP_SIGNATURE_LIST);

    for (int i = 0; i < purchaseDataList.size(); ++i) {
      String purchaseData = purchaseDataList.get(i);
      String signature = signatureList.get(i);
      String sku = ownedSkus.get(i);
      if (Security.verifyPurchase(mSignatureBase64, purchaseData, signature)) {
        logDebug("Sku is owned: " + sku);
        Purchase purchase = new Purchase(itemType, purchaseData, signature);

        if (TextUtils.isEmpty(purchase.getToken())) {
          logWarn("BUG: empty/null token!");
          logDebug("Purchase data: " + purchaseData);
        }

        // Record ownership and token
        inv.addPurchase(purchase);
      } else {
        logWarn("Purchase signature verification **FAILED**. Not adding item.");
        logDebug(" Purchase data: " + purchaseData);
        logDebug(" Signature: " + signature);
        verificationFailed = true;
      }
    }

    continueToken = ownedItems.getString(INAPP_CONTINUATION_TOKEN);
    logDebug("Continuation token: " + continueToken);
  } while (!TextUtils.isEmpty(continueToken));

  return verificationFailed ? IABHELPER_VERIFICATION_FAILED : BILLING_RESPONSE_RESULT_OK;
}

private void manageNotificationAuthorizeIntent(Bundle extras) {
  // Read Intent
  String phone = extras.getString(Intents.EXTRA_SMS_PHONE);
  Bundle params = extras.getBundle(Intents.EXTRA_SMS_PARAMS);
  long personId = MessageEncoderHelper.readLong(params, MessageParamEnum.PERSON_ID, -1l);
  GeopingNotifSlaveTypeEnum notifType =
      GeopingNotifSlaveTypeEnum.getByOrdinal(
          extras.getInt(Intents.EXTRA_NOTIFICATION_TYPE_ENUM_ORDINAL, -1));
  AuthorizePhoneTypeEnum type =
      AuthorizePhoneTypeEnum.getByOrdinal(
          extras.getInt(Intents.EXTRA_AUTHORIZE_PHONE_TYPE_ENUM_ORDINAL));
  Log.d(TAG, "******* AuthorizePhoneTypeEnum : " + type);
  String personNewName = extras.getString(Intents.EXTRA_PERSON_NAME);
  // Cancel Notification
  int notifId = extras.getInt(Intents.EXTRA_NOTIF_ID, -1);
  if (notifId != -1) {
    mNotificationManager.cancel(notifId);
  }
  // Read Pairing
  Pairing pairing = getPairingByPhone(phone);
  if (TextUtils.isEmpty(pairing.name) && personNewName != null) {
    pairing.name = personNewName;
  }
  // ### Manage Pairing Type
  // #############################
  Log.d(
      TAG,
      String.format(
          "manageAuthorizeIntent for phone %s with User security choice %s", phone, type));
  boolean positifResponse = false;
  switch (type) {
    case NEVER:
      doPairingPhone(pairing, PairingAuthorizeTypeEnum.AUTHORIZE_NEVER, personId);
      break;
    case ALWAYS:
      doPairingPhone(pairing, PairingAuthorizeTypeEnum.AUTHORIZE_ALWAYS, personId);
      positifResponse = true;
      break;
    case YES:
      positifResponse = true;
      if (AppConstants.UNSET_ID == pairing.id) {
        doPairingPhone(pairing, PairingAuthorizeTypeEnum.AUTHORIZE_REQUEST, personId);
      }
      break;
    default:
      Log.w(TAG, "Not manage PhoneAuthorizeTypeEnum for " + type);
      positifResponse = false;
      break;
  }

  // ### Manage Notification Type
  // #############################
  switch (notifType) {
    case GEOPING_REQUEST_CONFIRM:
      if (positifResponse) {
        GeoPingSlaveLocationService.runFindLocationAndSendInService(
            this, MessageActionEnum.LOC, new String[] {phone}, params);
      }
      break;
    default:
      break;
  }
}

