/**
 * Look up, or construct, based on the activity.
 *
 * <p>The activities fall into three cases, based on meta-data found in the manifest entry:
 *
 * <ol>
 *   <li>The activity itself implements search. This is indicated by the presence of a
 *       "android.app.searchable" meta-data attribute. The value is a reference to an XML file
 *       containing search information.
 *   <li>A related activity implements search. This is indicated by the presence of a
 *       "android.app.default_searchable" meta-data attribute. The value is a string naming the
 *       activity implementing search. In this case the factory will "redirect" and return the
 *       searchable data.
 *   <li>No searchability data is provided. We return null here and other code will insert the
 *       "default" (e.g. contacts) search.
 *       <p>TODO: cache the result in the map, and check the map first. TODO: it might make sense
 *       to implement the searchable reference as an application meta-data entry. This way we
 *       don't have to pepper each and every activity. TODO: can we skip the constructor step if
 *       it's a non-searchable? TODO: does it make sense to plug the default into a slot here for
 *       automatic return? Probably not, but it's one way to do it.
 *
 * @param activity The name of the current activity, or null if the activity does not define any
 *     explicit searchable metadata.
 */
public SearchableInfo getSearchableInfo(ComponentName activity) {
  // Step 1. Is the result already hashed? (case 1)
  SearchableInfo result;
  synchronized (this) {
    result = mSearchablesMap.get(activity);
    if (result != null) return result;
  }

  // Step 2. See if the current activity references a searchable.
  // Note: Conceptually, this could be a while(true) loop, but there's
  // no point in implementing reference chaining here and risking a loop.
  // References must point directly to searchable activities.

  ActivityInfo ai = null;
  try {
    ai = mPm.getActivityInfo(activity, PackageManager.GET_META_DATA, mUserId);
  } catch (RemoteException re) {
    Log.e(LOG_TAG, "Error getting activity info " + re);
    return null;
  }
  String refActivityName = null;

  // First look for activity-specific reference
  Bundle md = ai.metaData;
  if (md != null) {
    refActivityName = md.getString(MD_LABEL_DEFAULT_SEARCHABLE);
  }
  // If not found, try for app-wide reference
  if (refActivityName == null) {
    md = ai.applicationInfo.metaData;
    if (md != null) {
      refActivityName = md.getString(MD_LABEL_DEFAULT_SEARCHABLE);
    }
  }

  // Irrespective of source, if a reference was found, follow it.
  if (refActivityName != null) {
    // This value is deprecated, return null
    if (refActivityName.equals(MD_SEARCHABLE_SYSTEM_SEARCH)) {
      return null;
    }
    String pkg = activity.getPackageName();
    ComponentName referredActivity;
    if (refActivityName.charAt(0) == '.') {
      referredActivity = new ComponentName(pkg, pkg + refActivityName);
    } else {
      referredActivity = new ComponentName(pkg, refActivityName);
    }

    // Now try the referred activity, and if found, cache
    // it against the original name so we can skip the check
    synchronized (this) {
      result = mSearchablesMap.get(referredActivity);
      if (result != null) {
        mSearchablesMap.put(activity, result);
        return result;
      }
    }
  }

  // Step 3. None found. Return null.
  return null;
}

