        (args == null) ? getActivity().getIntent() : (Intent) args.getParcelable("intent");
    if (intent != null) {
      packageName = intent.getData().getSchemeSpecificPart();
    }
  }
  mAppEntry = mState.getEntry(packageName);

  if (mAppEntry == null) {
    return false; // onCreate must have failed, make sure to exit
  }

  // Get application info again to refresh changed properties of application
  try {
    mPackageInfo =
        mPm.getPackageInfo(
            mAppEntry.info.packageName,
            PackageManager.GET_DISABLED_COMPONENTS
                | PackageManager.GET_UNINSTALLED_PACKAGES
                | PackageManager.GET_SIGNATURES);
  } catch (NameNotFoundException e) {
    Log.e(TAG, "Exception when retrieving package:" + mAppEntry.info.packageName, e);
    return false; // onCreate must have failed, make sure to exit
  }

  // Get list of preferred activities
  List<ComponentName> prefActList = new ArrayList<ComponentName>();

  // Intent list cannot be null. so pass empty list
  List<IntentFilter> intentList = new ArrayList<IntentFilter>();
  mPm.getPreferredActivities(intentList, prefActList, packageName);
  if (localLOGV)
    Log.i(TAG, "Have " + prefActList.size() + " number of activities in prefered list");
  boolean hasUsbDefaults = false;
  try {
    hasUsbDefaults = mUsbManager.hasDefaults(packageName);
  } catch (RemoteException e) {
    Log.e(TAG, "mUsbManager.hasDefaults", e);
  }
  TextView autoLaunchView = (TextView) mRootView.findViewById(R.id.auto_launch);
  if (prefActList.size() <= 0 && !hasUsbDefaults) {
    // Disable clear activities button
    autoLaunchView.setText(R.string.auto_launch_disable_text);
    mActivitiesButton.setEnabled(false);
  } else {
    autoLaunchView.setText(R.string.auto_launch_enable_text);
    mActivitiesButton.setEnabled(true);
    mActivitiesButton.setOnClickListener(this);
  }

  // Screen compatibility section.
  ActivityManager am = (ActivityManager) getActivity().getSystemService(Context.ACTIVITY_SERVICE);
  int compatMode = am.getPackageScreenCompatMode(packageName);
  // For now these are always off; this is the old UI model which we
  // are no longer using.
  if (false
      && (compatMode == ActivityManager.COMPAT_MODE_DISABLED
          || compatMode == ActivityManager.COMPAT_MODE_ENABLED)) {
    mScreenCompatSection.setVisibility(View.VISIBLE);
    mAskCompatibilityCB.setChecked(am.getPackageAskScreenCompat(packageName));
    mAskCompatibilityCB.setOnCheckedChangeListener(this);
    mEnableCompatibilityCB.setChecked(compatMode == ActivityManager.COMPAT_MODE_ENABLED);
    mEnableCompatibilityCB.setOnCheckedChangeListener(this);
  } else {
    mScreenCompatSection.setVisibility(View.GONE);
  }

  // Security permissions section
  LinearLayout permsView = (LinearLayout) mRootView.findViewById(R.id.permissions_section);
  AppSecurityPermissions asp = new AppSecurityPermissions(getActivity(), packageName);
  if (asp.getPermissionCount() > 0) {
    permsView.setVisibility(View.VISIBLE);
    // Make the security sections header visible
    LinearLayout securityList =
        (LinearLayout) permsView.findViewById(R.id.security_settings_list);
    securityList.removeAllViews();
    securityList.addView(asp.getPermissionsView());
  } else {
    permsView.setVisibility(View.GONE);
  }

  checkForceStop();
  setAppLabelAndIcon(mPackageInfo);
  refreshButtons();
  refreshSizeInfo();
  return true;
}

private Result handleResultOk(Intent data) {
  Bundle extras = data.getExtras();
  String errorType = extras.getString(NativeProtocol.STATUS_ERROR_TYPE);
  if (errorType == null) {
    return Result.createTokenResult(
        AccessToken.createFromNativeLogin(
            extras, AccessTokenSource.FACEBOOK_APPLICATION_NATIVE));
  } else if (NativeProtocol.ERROR_SERVICE_DISABLED.equals(errorType)) {
    return null;
  } else if (NativeProtocol.ERROR_USER_CANCELED.equals(errorType)) {
    return Result.createCancelResult(null);
  } else {
    return Result.createErrorResult(errorType, extras.getString("error_description"));
  }
}

