/**
 * Returns a boolean indicating whether a Bundle contains properties that could be a valid saved
 * token.
 *
 * @param bundle A Bundle to check for token information.
 * @return a boolean indicating whether a Bundle contains properties that could be a valid saved
 *     token.
 */
public static boolean hasTokenInformation(Bundle bundle) {
  if (bundle == null) {
    return false;
  }

  String token = bundle.getString(TOKEN_KEY);
  if ((token == null) || (token.length() == 0)) {
    return false;
  }

  long expiresMilliseconds = bundle.getLong(EXPIRATION_DATE_KEY, 0L);
  if (expiresMilliseconds == 0L) {
    return false;
  }

  return true;
}

static AccessToken createFromNativeLogin(Bundle bundle, AccessTokenSource source) {
  Date expires =
      getBundleLongAsDate(bundle, NativeProtocol.EXTRA_EXPIRES_SECONDS_SINCE_EPOCH, new Date(0));
  ArrayList<String> permissions = bundle.getStringArrayList(NativeProtocol.EXTRA_PERMISSIONS);
  String token = bundle.getString(NativeProtocol.EXTRA_ACCESS_TOKEN);

  return createNew(permissions, token, expires, source);
}

