private void encodeQRCodeContents(Intent intent, String type) {
  if (type.equals(Contents.Type.TEXT)) {
    String data = intent.getStringExtra(Intents.Encode.DATA);
    if (data != null && data.length() > 0) {
      contents = data;
      displayContents = data;
      title = activity.getString(fakeR.getId("string", "contents_text"));
    }
  } else if (type.equals(Contents.Type.EMAIL)) {
    String data = ContactEncoder.trim(intent.getStringExtra(Intents.Encode.DATA));
    if (data != null) {
      contents = "mailto:" + data;
      displayContents = data;
      title = activity.getString(fakeR.getId("string", "contents_email"));
    }
  } else if (type.equals(Contents.Type.PHONE)) {
    String data = ContactEncoder.trim(intent.getStringExtra(Intents.Encode.DATA));
    if (data != null) {
      contents = "tel:" + data;
      displayContents = PhoneNumberUtils.formatNumber(data);
      title = activity.getString(fakeR.getId("string", "contents_phone"));
    }
  } else if (type.equals(Contents.Type.SMS)) {
    String data = ContactEncoder.trim(intent.getStringExtra(Intents.Encode.DATA));
    if (data != null) {
      contents = "sms:" + data;
      displayContents = PhoneNumberUtils.formatNumber(data);
      title = activity.getString(fakeR.getId("string", "contents_sms"));
    }
  } else if (type.equals(Contents.Type.CONTACT)) {

    Bundle bundle = intent.getBundleExtra(Intents.Encode.DATA);
    if (bundle != null) {

      String name = bundle.getString(ContactsContract.Intents.Insert.NAME);
      String organization = bundle.getString(ContactsContract.Intents.Insert.COMPANY);
      String address = bundle.getString(ContactsContract.Intents.Insert.POSTAL);
      Collection<String> phones = new ArrayList<String>(Contents.PHONE_KEYS.length);
      for (int x = 0; x < Contents.PHONE_KEYS.length; x++) {
        phones.add(bundle.getString(Contents.PHONE_KEYS[x]));
      }
      Collection<String> emails = new ArrayList<String>(Contents.EMAIL_KEYS.length);
      for (int x = 0; x < Contents.EMAIL_KEYS.length; x++) {
        emails.add(bundle.getString(Contents.EMAIL_KEYS[x]));
      }
      String url = bundle.getString(Contents.URL_KEY);
      String note = bundle.getString(Contents.NOTE_KEY);

      ContactEncoder mecardEncoder =
          useVCard ? new VCardContactEncoder() : new MECARDContactEncoder();
      String[] encoded =
          mecardEncoder.encode(
              Collections.singleton(name),
              organization,
              Collections.singleton(address),
              phones,
              emails,
              url,
              note);
      // Make sure we've encoded at least one field.
      if (encoded[1].length() > 0) {
        contents = encoded[0];
        displayContents = encoded[1];
        title = activity.getString(fakeR.getId("string", "contents_contact"));
      }
    }

  } else if (type.equals(Contents.Type.LOCATION)) {
    Bundle bundle = intent.getBundleExtra(Intents.Encode.DATA);
    if (bundle != null) {
      // These must use Bundle.getFloat(), not getDouble(), it's part of the API.
      float latitude = bundle.getFloat("LAT", Float.MAX_VALUE);
      float longitude = bundle.getFloat("LONG", Float.MAX_VALUE);
      if (latitude != Float.MAX_VALUE && longitude != Float.MAX_VALUE) {
        contents = "geo:" + latitude + ',' + longitude;
        displayContents = latitude + "," + longitude;
        title = activity.getString(fakeR.getId("string", "contents_location"));
      }
    }
  }
}

private int addComments(Bundle bundle) {

  final StringBuilder urlBuilder = new StringBuilder(Preferences.domain);
  urlBuilder.append("/api");
  final HashMap<String, String> mParams = new HashMap<String, String>();

  if (bundle != null) {
    if (bundle.getInt("report_id") > 0) {

      mParams.put("incident_id", String.valueOf(bundle.getInt("report_id")));
    }

    if (bundle.getInt("checkin_id") > 0) {
      Log.i("Comment ", "ID " + bundle.getInt("checkin_id"));
      mParams.put("checkin_id", String.valueOf(bundle.getInt("checkin_id")));
    }

    mParams.put("comment_author", bundle.getString("comment_author"));
    mParams.put("comment_description", bundle.getString("comment_description"));
    mParams.put("comment_email", bundle.getString("comment_email"));

    try {
      if (new CommentHttpClient(this).PostFileUpload(urlBuilder.toString(), mParams)) {
        // fetch comments
        if (bundle.getInt("report_id") > 0) {
          new CommentHttpClient(this).getReportComments(bundle.getInt("report_id"));
        }
        if (bundle.getInt("checkin_id") > 0) {
          new CommentHttpClient(this).getCheckinComments(bundle.getInt("checkin_id"));
        }
        return 0;
      }
      return 1;
    } catch (IOException e) {
      return 2;
    }
  }
  return 1;
}

@Override
@SuppressWarnings("deprecation")
public boolean shouldOverrideUrlLoading(WebView view, String url) {
  Utility.logd(LOG_TAG, "Redirect URL: " + url);
  if (url.startsWith(WebDialog.REDIRECT_URI)) {
    Bundle values = Util.parseUrl(url);

    String error = values.getString("error");
    if (error == null) {
      error = values.getString("error_type");
    }

    String errorMessage = values.getString("error_msg");
    if (errorMessage == null) {
      errorMessage = values.getString("error_description");
    }
    String errorCodeString = values.getString("error_code");
    int errorCode = FacebookRequestError.INVALID_ERROR_CODE;
    if (!Utility.isNullOrEmpty(errorCodeString)) {
      try {
        errorCode = Integer.parseInt(errorCodeString);
      } catch (NumberFormatException ex) {
        errorCode = FacebookRequestError.INVALID_ERROR_CODE;
      }
    }

    if (Utility.isNullOrEmpty(error)
        && Utility.isNullOrEmpty(errorMessage)
        && errorCode == FacebookRequestError.INVALID_ERROR_CODE) {
      sendSuccessToListener(values);
    } else if (error != null
        && (error.equals("access_denied") || error.equals("OAuthAccessDeniedException"))) {
      sendCancelToListener();
    } else {
      FacebookRequestError requestError =
          new FacebookRequestError(errorCode, error, errorMessage);
      sendErrorToListener(new FacebookServiceException(requestError, errorMessage));
    }

    WebDialog.this.dismiss();
    return true;
  } else if (url.startsWith(WebDialog.CANCEL_URI)) {
    sendCancelToListener();
    WebDialog.this.dismiss();
    return true;
  } else if (url.contains(DISPLAY_TOUCH)) {
    return false;
  }
  // launch non-dialog URLs in a full browser
  getContext().startActivity(new Intent(Intent.ACTION_VIEW, Uri.parse(url)));
  return true;
}

